function formatItem(a){return a[1];}function formatResult(a){return a[1].replace(/(<.+?>)/gi,"");}function initjQueryAutoComplete(a,b,c){jQuery(document).ready(function(){jQuery(""+a).autocomplete(b,{width:c,multiple:true,matchContains:true,selectFirst:false,formatItem:formatItem,formatResult:formatResult});});}